

angular.module(_CONTROLLERS_).controller('HomeController', ['$scope', 'Account', '$location','geolocation','phonegapReady','$rootScope', function($scope, Account, $location,geolocation,phonegapReady, $rootScope) {

    // trying to fix geolocation bug after login
    geolocation.getCurrentPosition(function(){}, function(){});

    var _account = Account.account();
    if(_account.user){
        $location.path('/dashboard');
    }
    $scope.newAccount = {dog : {}};
    $scope.state = "welcome";

    $scope.createAccount = function(){
        var a = $scope.newAccount;
        if(!a.dog || !a.dog.name || !a.base64Image){
            console.error('error validating details');
            $scope.error = "Please fill in all the details";
            return;
        }
        $scope.runtime.showLoader = true;

        Account.create($scope.newAccount, function(err, account){
            $scope.runtime.showLoader = false;
            if(err){
                console.error(err);
                $scope.error = "Error sign up. Please try again.";
            }else{
                $location.path('/dashboard');
            }
        });
    };


    $scope.takePicture = function(gallery){

        var dt = 0; // DATA_URL
        var sourceType = (gallery) ? 0 : 1 ;
        $scope.newAccount.base64Image = null;
        $scope.newAccountDogThumbnail = null;

        navigator.camera.getPicture( function(result){
            $scope.$apply(function(){
                $scope.newAccount.base64Image = result;
                $scope.newAccountDogThumbnail = "data:image/png;base64," + result;
                $scope.state = "finish";
                $scope.showOverlay = false;

            });
        }, function(err){
            console.error('error taking picture',err);
            $rootScope.safeApply(function(){
                applyDevPicture();
            });

        }, { quality: 30, destinationType: dt, allowEdit: true, sourceType : sourceType
        });
    };


    var applyDevPicture = function(){
        console.log('applyDevPicture');
        $scope.newAccount.base64Image = "";
        $scope.newAccountDogThumbnail = "data:image/png;base64," + $scope.newAccount.base64Image;
        $scope.state = "finish";
        $scope.showOverlay = false;
    }


}]);
